description.narrative:
The project has to contribute to the following impact and must achieve the outcomes and outputs as stated below.

The proposed project must contribute to the following objective:
- End hunger (SDG 2).

The proposed project must contribute to one or more of the following long-term impacts:
- promote agricultural growth;
- create ecologically sustainable food systems;
- water efficiency in agriculture increased.

Medium-term impact that will contribute to this:
(l) Education system (TVET/HE) is of good quality, relevant and accessible (SDG 4);
(Il) Partnerships between persons and organisations are inclusive and sustainable (SDG 17);
(Ill) Organisations key to (sectoral) inclusive development of partner countries are strengthened by inflow of enhanced workforce.

Outcomes:
A. TVET/HE organísations (in the selected partner countries and in NL) perform better their core tasks, firmly embedded in their environment (in line with country / regional specific labour market needs & aiming at inclusiveness).

To that end, the following outputs must be achieved by the end of the project:

(1)  Agricultural teacher training curricula at Teacher Training Institutes (Colleges) and Higher Education Institutes improved through the use of CBET and inclusion of 21st century learning skills, gender sensitiveness, improved traineeship programmes both in TVET institutes and private companies, inclusion of good agriculture practices and responsiveness to labour market demands through active collaboration with the private sector based on TVETA, KNQA and CDACC requirements.

Sub-outputs:
Output 1.1: Occupational profile for ATVET trainers designed and validated by labour market;
Output 1.2: Quality standards and learning outcomes for ATVET teachers designed and validated;
Output 1.3: Existing ATVET te«:»cher training curricula for certificate, diploma and in-service training based on occupational profile and standards are validated and accredited;
Output 1.4: Traineeship Assessment process and tools focussing on performance in traineeship designed and validated;
Output 1.5: Blended learning Mobile phone application for ATVET teacher trainers and teacher training students, aligned to curricula for pre- and in-service training is developed and validated.

(2) Quality of ATVET teaching improved through the enhancement of pre-service and in-service training of agricultural trainers on the design and implementation of  gender sensitive CBET including the integration of ICT based and blended learning methods for particular didactical and agriculture/technical training skills with proven responsiveness to demands in the agricultural sector.

Sub-outputs:
Output 2.1 : Capacity of ATVET teacher trainers on gender-responsive and CBET pedagogies improved;
Output 2.2: Handbooks / guides for traineeships in ATVET Institutes and private companies validated and approved.

(3) Establishment of sustainable partnerships based on mutual benefits enhancing joint delivery and financing of training programmes. The partnerships will be established between (i) ATVET Teacher Training Institutes with TVET institutions and the private sector and between (ii) ATVET Higher Education Institutes with TVET institutions and private sector to offer traineeships and workplace based learning facilities for ATVET teocmers and students.

Sub-outputs:
Output 3.1 : Private sector companies provide traineeships for ATVET teacher training students;
Output 3.2: ATVET institutions provide traineeships for students of teacher training programmes.

(4) Enhance TVETA capability to provide and facilitate the implementation of quality assurance mechanisms specifically for agricultural (teacher) training programmes based on public-private collaboration, the CBETA standards and national accreditation mechanisms for institutes, programmes and trainers.

Sub-outputs:
Output 4.1 : TVETA registration and certification process of traineeship in companies ond ATVET Institutes piloted and in place;
Output 4.2: Capacity of TVETA and ATVET Institutes on accreditation, certification and QA mechanisms developed and piloted;
Output 4.3: TVETA accreditation improved ATVET +eacher training courses with traineeships using QA mechanisms.
